import React from "react";
import styled, { css } from 'styled-components';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    color: #F1F1F1;
    text-align: center;
`;
const Big_Title = styled.div`
    font-weight: 700;
    font-size: 40px;
    text-transform: uppercase;
`;
const Error = styled.div`
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 900;
    font-size: 150px;
`;
export default function Error404() {
    return(
        <>
        <Container>
            <Big_Title>Woops! something went wrong</Big_Title>
            <Error>404</Error>
        </Container>
        </>
    );
}
